import React from "react";
import { useRef } from "react";

const Input = (props)=> {

    const {value, placeholder} =props;

    return(
        <React.Fragment>
            <input ref={props.value} placeholder={props.placeholder}/>
        </React.Fragment>
    )
}


Input.defaultProps = {
    value : "",
    placeholder: "입력해주세요"
}

export default Input;
